SELECT DISTINCT ?property WHERE {
  ?equipment a mes_ontology_populated:Equipment .
  ?equipment ?property ?value .
  FILTER(ISIRI(?property))
  FILTER CONTAINS(STR(?property), "product")
}

SELECT DISTINCT ?property WHERE {
  ?event a mes_ontology_populated:ProductionLog .
  ?event ?property ?value .
  FILTER(ISIRI(?property))
}

SELECT (sum(?goodUnits + ?scrapUnits) AS ?totalUnits) {
  ?equipment mes_ontology_populated:belongsToLine mes_ontology_populated:LINE2 .
  ?equipment mes_ontology_populated:logsEvent ?event .
  ?event mes_ontology_populated:hasGoodUnits ?goodUnits .
  ?event mes_ontology_populated:hasScrapUnits ?scrapUnits
}

SELECT DISTINCT ?property WHERE {
  ?equipment mes_ontology_populated:logsEvent ?event .
  ?event ?property ?value .
  FILTER(ISIRI(?property))
  FILTER (CONTAINS(STR(?property), "unit") || CONTAINS(STR(?property), "volume"))
}

SELECT DISTINCT ?property WHERE {
  ?equipment mes_ontology_populated:logsEvent ?event .
  ?event ?property ?value .
  FILTER(ISIRI(?property))
  FILTER CONTAINS(STR(?property), "rate")
}

SELECT ?timestamp ?reason WHERE {
  ?equipment mes_ontology_populated:belongsToLine mes_ontology_populated:LINE2 .
  ?equipment mes_ontology_populated:logsEvent ?event .
  ?event a mes_ontology_populated:DowntimeLog .
  ?event mes_ontology_populated:hasTimestamp ?timestamp .
  OPTIONAL { ?event mes_ontology_populated:hasDowntimeReasonCode ?reason }
  FILTER(ISIRI(?equipment))
}
ORDER BY DESC(?timestamp)

SELECT (COUNT(*) AS ?jamCount) WHERE {
  SELECT ?event WHERE {
    mes_ontology_populated:LINE2-PCK mes_ontology_populated:logsEvent ?event .
    ?event a mes_ontology_populated:DowntimeLog .
    ?event mes_ontology_populated:hasDowntimeReasonCode ?reason .
    FILTER (?reason = "UNP-JAM")
  }
}

SELECT (COUNT(?event) AS ?jamCount) WHERE {
  mes_ontology_populated:LINE2-PCK mes_ontology_populated:logsEvent ?event .
  ?event a mes_ontology_populated:DowntimeLog .
  ?event mes_ontology_populated:hasDowntimeReasonCode ?reason .
  FILTER (?reason = "UNP-JAM")
}

SELECT ?timestamp ?reason WHERE {
  mes_ontology_populated:LINE2-PCK mes_ontology_populated:logsEvent ?event .
  ?event a mes_ontology_populated:DowntimeLog .
  ?event mes_ontology_populated:hasTimestamp ?timestamp .
  OPTIONAL { ?event mes_ontology_populated:hasDowntimeReasonCode ?reason }
} 
